import React from "react";

const Profile = () => {
  return (
    <div className="profile__box">
      <div className="flex__box-lg">
        <div className="profile__image" />
        <div>
          <div className="profile__email"></div>
          <div className="profile__name"></div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
